import matplotlib.pyplot as plt
import numpy as np
import wave
import sys

def chunks(data, size):
    """Yield successive n-sized chunks from data."""
    for i in range(0, len(data), size):
        yield data[i:i + size]

# ---------------------------------------- train 0, -----------------------------------------

spf = wave.open('/home/rafael/Desktop/rp_speech/src/Train0/person0.wav','rb')

#Extract Raw Audio from Wav File
signal = spf.readframes(-1)
signal = np.fromstring(signal, 'Int16')
fs = spf.getframerate()

#If Stereo
if spf.getnchannels() == 2:
    print('Just mono files')
    sys.exit(0)


Time=np.linspace(0, len(signal)/fs, num=len(signal))

plt.figure(1)
plt.title('Signal Wave training 0')
plt.plot(Time,signal)
plt.savefig("train_person0.png")

# ---------------------------------------- train 1, -----------------------------------------

spf = wave.open('/home/rafael/Desktop/rp_speech/src/Train1/person1.wav','rb')

#Extract Raw Audio from Wav File
signal = spf.readframes(-1)
signal = np.fromstring(signal, 'Int16')
fs = spf.getframerate()

#If Stereo
if spf.getnchannels() == 2:
    print('Just mono files')
    sys.exit(0)


Time=np.linspace(0, len(signal)/fs, num=len(signal))

plt.figure(2)
plt.title('Signal Wave training 1')
plt.plot(Time,signal)
plt.savefig("train_person1.png")

# ---------------------------------------- test -----------------------------------------

spf = wave.open('/home/rafael/Desktop/rp_speech/src/Test/10SecsInterval.wav','rb')

#Extract Raw Audio from Wav File
signal = spf.readframes(-1)
signal = np.fromstring(signal, 'Int16')
fs = spf.getframerate()

#If Stereo
if spf.getnchannels() == 2:
    print('Just mono files')
    sys.exit(0)


time=np.linspace(0, len(signal)/(10*fs), num=len(signal))
chunks_obj = chunks(signal, 10*fs)
time_obj = chunks(time, 10*fs)

plt.figure(3)
plt.title('Signal Wave training 1')

color = 'blue'
try:
    while(True):
        plt.plot(next(time_obj),next(chunks_obj), color = color)
        time = time+(10*fs)
        if(color == "blue"):
            color = "red"
        else:
            color = "blue"
except:
    pass

plt.show()
